import characters from '../db/Character/Character';



function Character() {

  return (
    <>
      <h1>List of Characters</h1>
      <ul>
        <characters />
        {characters.map((i) => 
        <List 
        key={i.char_id} 
        id={i.char_id}
        name={i.name}
        id={i.char_id}
        id={i.char_id}
        id={i.char_id}
        id={i.char_id}
        id={i.char_id}
        id={i.char_id}
        id={i.char_id}
        id={i.char_id}

         />)}
      </ul>
    </>
  );
}
export default Character;
